19	1	2	1	PROMOTION DE LA SANTE	528	L'un des défis majeur du secteur santé est d'agir sur les déterminants de la santé et donner aux\r\nindividus les moyens de maitriser et d'améliorer leur état de santé.\r\nDans ce programme, le MINSANTE veut contribuer à induire par des actions ciblées des changements\r\nde comportement dans la population et amener les individus à adopter des modes de vie sains	-	La mise en oeuvre se fera à travers les actions suivantes:\r\n-\tPromotion des comportements favorables à la santé\r\n-\tRenforcement de la planification familiale\r\n-\tAmélioration du milieu de vie des populations\r\n-\tRenforcement de la participation communautaire\r\n-\tPromotion de la santé de l'adolescent\r\n		Actif	2016-03-03	2017-10-31	Agir sur les déterminants de la santé et donner aux individus les moyens de\r\nmaitriser et d'améliorer leur état de santé	\N	\N	\N	\N	\N
20	1	1	1	GOUVERNANCE ET APPUI INSTITUTIONNEL DANS LE SECTEUR SANTE	530	La stratégie de ce programme repose sur les objectifs spécifiques suivants:\r\n-Mettre en place un système performant d'approvisionnement, de distribution, de stockage et d'utilisation\r\nde médicaments de qualité à tous les niveaux ;\r\n-Améliorer l'offre des soins et des services tant au milieu hospitalier que communautaire ;\r\n-Assurer la disponibilité et l'utilisation optimales des ressources humaines de qualité ;\r\n-Améliorer l'accessibilité financière des populations aux soins et services de santé ;\r\n-Améliorer la disponibilité et l'utilisation des informations sanitaires de qualité.\r\n-Améliorer le pilotage stratégique du secteur\r\n-Améliorer la gouvernance du secteur	--	La mise en oeuvre de ce programme se fera à travers les actions suivantes:\r\n\r\n-\tGestion des médicaments, réactifs et dispositifs médicaux\r\n\r\n-\tAmélioration de l'offre de soins et services de santé\r\n\r\n-\tRenforcement du financement de la santé et du partenariat\r\n\r\n-\tDéveloppement des ressources humaines en santé\r\n\r\n-\tDéveloppement du système d'information sanitaire et la\r\n\r\n-\tRecherche opérationnelle en santé\r\n\r\n-\tPilotage stratégique du secteur\r\n\r\n-\tContrôle et audit interne des structures		Actif	2016-03-03	2017-10-31	Améliorer la coordination des services et assurer la bonne mise en œuvre des\r\nprogrammes	\N	\N	\N	\N	\N
18	1	2	1	PREVENTION DE LA MALADIE	527	La stratégie du programme prévention de la maladie repose sur les objectifs spécifiques suivants:\r\n-Réduire l'incidence / prévalence des principales maladies transmissibles ;\r\n-Réduire la prévalence des maladies chroniques non-transmissibles;\r\n-Renforcer le système de surveillance intégré des maladies à potentiel épidémique et des évènements\r\nde santé publiques majeurs (catastrophes et urgences sanitaires,Ã¢â‚¬Â¦);\r\n-Améliorer l'utilisation des services de prévention de la maladie	-	La mise en action de ce programme se fera à travers les actions suivantes:\r\n-\tPrévention du paludisme\r\n-\tPrévention du VIH/SIDA, tuberculose, IST et hépatites virales\r\n-\tPrévention de la transmission du VIH de la mère à l'enfant\r\n-\tPrévention des maladies à potentiel épidémique(MAPE)\r\n-\tPrévention des maladies chroniques non transmissibles (MCNT)\r\n-\tPrévention des maladies tropicales négligées (MTN)\r\n-\tPrévention des autres maladies\r\n		Actif	2016-03-03	2017-10-31	Améliorer la couverture des interventions de prévention de la maladie	\N	\N	\N	\N	\N
17	1	2	1	PRISE EN CHARGE DES CAS	 531	La stratégie du programme prise en charge des cas repose sur les objectifs spécifiques suivants:\r\n-Améliorer la prise en charge des cas et des complications des principales maladies transmissibles et\r\nnon-transmissibles ;\r\n-Améliorer prise en charge des cas et des complications liées à la santé de la mère ,du nouveau-né, de\r\nl'enfant et de l'adolescent .	 Conseiller Technique NÃ‚Â°3	La mise en oeuvre de cette action se fera à travers les actions suivantes:\r\n- Mise en œuvre des interventions curatives à haut impact chez la mère, le nouveau-né, l'enfant et l'adolescent;\r\n- Prise en charge des urgences et des catastrophes ;\r\n- Prise en charge du VIH/SIDA, tuberculose, IST et hépatites virales ;\r\n- Prise en charge du paludisme ;\r\n- Prise en charge des maladies chroniques non transmissibles(MCNT) ;\r\n- Prise en charge des maladies tropicales négligées et des autres maladies ;\r\n- Offre infrastructurelles et équipements des formations sanitaires.\r\n\r\nAUTRES MALADIES\r\nACTION 07: OFFRE INFRACSTRUCTURELLES ET EQUIPEMENTS DES FORMATIONS\r\nSANITAIRES		Actif	2016-03-03	2017-10-31	Améliorer l'accès des populations aux soins curatifs de qualité, notamment pour la cible mère et enfant en vue de réduire la charge morbide et la mortalité.	\N	\N	\N	\N	\N
