1	2	\N		La mise en œuvre de ce programme obéit aux orientations du  DSCE dans son volet développement humain qui préconise Ã‚Â« l'amélioration de l'état de santé des populations Ã‚Â», en cohérence avec les  OMD  4, 5, 6 spécifiques à la santé. \r\nLa Stratégie Sectorielle de la Santé prévoit deux domaines : le domaine de la lutte contre la maladie et celui de la promotion de la santé. Ces derniers temps la recrudescence des épidémies et des pandémies, le faible accès aux soins et aux médicaments  pour la prise en charge des communautés sont des raisons qui confortent la pertinence de ce programme prioritaire de la feuille de route du MINSANTE. \r\nPour ce programme il s'agissait de réduire la charge morbide chez les pauvres et les populations les plus vulnérables, à travers  04 actions inscrites et exécutées : \r\n-Amélioration de la disponibilité et l'accessibilité de l'offre des médicaments, réactifs, et dispositifs essentiels ;\r\n- Prévention de la maladie et promotion de la santé ;\r\n- Prise en Charge globale et intégrée des maladies ;\r\n- Renforcement du système communautaire.\r\n	\N			\N	\N	\N	\N	Actif	2015-03-31	2015-03-31
2	20	\N		Malgré les résultats positifs enregistrés par le MINSANTE ces dernières années, Le diagnostic du secteur Santé a permis d'identifier la faible gouvernance et l'insuffisance du pilotage stratégique comme les principaux goulots d'étranglement dans le système de santé au Cameroun. En ce qui concerne la gouvernance, elle est caractérisée par: l'insuffisance du cadre législatif et règlementaire; la faible transparence et redevabilité ; la participation insuffisante des bénéficiaires au processus gestionnaire et l'insuffisance des compétences des gestionnaires. Pour ce qui est du pilotage stratégique, il est caractérisé par: un dispositif institutionnel inapproprié ; un fonctionnement inadéquat de la chaine Ã‚Â« planification, programmation, budgétisation et suivi-évaluation Ã‚Â» ; une faiblesse de la veille stratégique ; une lenteur du processus de déconcentration/décentralisation  et une gestion non-optimale du partenariat national et international.\r\nOn note également une faible performance des autres piliers du système de Santé qui affecte la performance globale. Une analyse de chacun de ces piliers permet d'avoir les résultats suivants :\r\n-Pour ce qui est du Financement de la Santé, (i) Le pays ne dispose pas d'une stratégie nationale de financement de la santé. (ii) Les différentes fonctions du financement (collecte des ressources, mécanismes de partage des risques, et achat des services de santé) ne répondent donc pas à un cadre logique national.(iii) La Santé reste sous financée à travers le budget national (moins de 6% du budget national alloué à la santé) et les ménages en supportent une part importante à travers les payements directs (52 % d'après les résultats des comptes nationaux de 2011). (iv) Le taux d'exécution budgétaire (base engagement) a oscillé entre 88% et 96% sur la période 2010-2015. \r\n-Concernant l'Offre des services et Soins de Santé,(i)Les hôpitaux de 1ère et de 2ème catégorie qui constituent les deux types de Formations Sanitaires (FOSA) du niveau central ne parviennent pas à jouer pleinement leur rôle de structures de référence ; principalement du fait de l'insuffisance des plateaux techniques appropriés et des références tardives. (ii) Ces hôpitaux sensés apporté un appui spécialisé aux FOSA du niveau déconcentré délivrent plutôt les Paquets Minimum et Complémentaire d'Activité (PMA et PCA) au mÃƒÂªme titre que les hôpitaux de districts et certains CMA.(iii) Afin d'améliorer l'accessibilité aux soins, des efforts sont faits pour subventionner la prise en charge de certaines maladies chroniques dans ces structures sanitaires notamment : les insuffisances rénales terminales nécessitant une dialyse et certains cancers.(iv)La plupart des structures de santé au niveau opérationnel n'ont pas un niveau de développement  leur permettant d'offrir  de manière optimale le PMA et le PCA aux populations.A titre d'illustration, les résultats de l'enquÃƒÂªte PETS II conduite au niveau des Districts de santé montrent que 24,5% des formations sanitaires ne disposaient pas de boite d'accouchement, 39,5% manquaient de système de stérilisation à sec, 67,5% manquaient de boite de césarienne, 11,6% manquaient de microscopes fonctionnels.(v)La maintenance des équipements biomédicaux n'est pas assurée à cause du manque de personnel multidisciplinaire compétent dédié à cette tÃƒÂ¢che ; (vi)Les crédits de fonctionnement alloués aux formations sanitaires sont insuffisants et difficiles à mobiliser au regard des procédures administratives en vigueur. L'analyse  de ce pilier démontre la vulnérabilité de notre système de soin qui pourrait ÃƒÂªtre amélioré par une allocation suffisante des ressources financières au MINSANTE et le développement de Ã‚Â« l'achat stratégique Ã‚Â» des interventions de santé.\r\n- S'agissant du secteur Pharmaceutique, laboratoire, médicaments et autres produits médicaux, (i)Le ratio pharmacien par habitant varie de 1 pour 6 920 à 1 pour 177 051 habitants en fonction des régions. (ii) La durée moyenne   de rupture de stock de médicaments traceurs au premier semestre 2015 était de 18 jours . (iii) Certaines classes thérapeutiques sont délivrées gratuitement ou sont subventionnées (antituberculeux, antirétroviraux de 1ère et 2eme lignes, combinaisons antipaludiques ACT, Artesunate et Artémether injectable pour les enfants de 0 à 5 ans, anti-lépromateux, certains anti-cancéreux etc.). Le contrôle de qualité qui est assuré par le LANACOME n'est malheureusement pas systématique pour les lots de médicaments importés; par ailleurs l'inspection  des établissements pharmaceutiques reste irrégulière. (iv) Le phénomène de l'offre informelle pharmaceutique s'est développé de faÃƒÂ§on exponentielle exposant le consommateur à la consommation de  produits sous dosés, contrefaits et parfois périmés.\r\n- En ce qui concerne les Ressources Humaines en Santé, Le secteur de la santé en 2012 comptait   7 534 agents de santé toutes catégories confondues. (i) Le Plan stratégique de développement des ressources humaines pour la santé (PSDRHS 2013-2020) relevait une  insuffisance de personnel dans les catégories suivantes : médecins, pharmaciens, infirmiers qualifiés et sages-femmes. Par ailleurs, on notait leur concentration dans les centres urbains, en particulier Yaoundé et Douala. On avait en outre  les ratios suivants : (i) Un médecin pour 28 466 habitants en 2012, ce qui est inférieur aux normes de l'OMS qui recommande un médecin pour 10 000 habitants (ii) Un Infirmier Diplômé d'Etat pour 12 903 habitants, (iii) Une Sage-Femme pour 9 596 femmes en ÃƒÂ¢ge de procréer, (iv) Un infirmier qualifié (toute catégorie confondue) pour 2 442 habitants en 2012 pour une norme OMS d'un pour 3000 habitants.(ii) La multitude des écoles de formation médicale  et paramédicale   devrait aboutir à  une surproduction des professionnels de santé  au cours des cinq prochaines années. Cette situation poserait alors un réel problème d'absorption du personnel formé avec un risque potentiel de mauvaises pratiques.(iii) on note également une instabilité du personnel de santé au poste de travail. Les salaires pratiqués à ce jour  dans la fonction publique ne favorisent pas la rétention du personnel et expliquent en partie la fuite des cerveaux ; (iv) en effet, Le niveau de rémunération des RHS est bas quel que  soit la catégorie et le  corps considérés. En outre,  avec  la gratuité des soins pour les cibles mère et enfant, dans les formations sanitaires publiques, le personnel d'appui et de certains prestataires des soins pourtant indispensable et qui est  rémunéré sur la  base du recouvrement des coÃƒÂ»ts devient une préoccupation majeure.\r\n- En ce qui concerne le Système National d'Informations Sanitaires (SNIS) et la Recherche en Santé , (i) on note une fragmentation du cadre institutionnel et organisationnel du SNIS et une multiplicité de sous-systèmes d'information et d'outils de collecte des données.(ii) Une faible allocation des ressources aux activités de recherche.\r\n	\N			\N	\N	\N	\N	Actif	2016-03-31	2016-04-26
3	20	\N	Produit N° 1 : .....................................................................................................................................................................................\r\n\r\nProduit N° 2 : .....................................................................................................................................................................................\r\n\r\nProduit N° 3 : .....................................................................................................................................................................................\r\n\r\nProduit N° 4 : .....................................................................................................................................................................................\r\n\r\nProduit N° 5 : .....................................................................................................................................................................................\r\n\r\nProduit N° 6 : .....................................................................................................................................................................................	Le Document de Stratégie pour la Croissance et l’Emploi (DSCE) adopté en 2009 est selon le Chef de l’Etat « le cadre de référence de l’action gouvernementale ». Il s’articule sur trois Axes notamment l’Axe Croissance, l’Axe Emploi et l’Axe Gestion Stratégique de l’Etat et Gouvernance. S’agissant particulièrement de l’Axe Croissance, il repose sur cinq piliers dont le Développement Humain qui constitue l’ancrage stratégique sur lequel repose les interventions du secteur santé. Ainsi, le MINSANTE, socle institutionnel desdites interventions a pour mission prépondérante : « d’améliorer l’état de santé des populations ».\r\nPour atteindre l’objectif sus-visé, le Ministère de la Santé Publique a mis en uvre le budget programme conformément à la loi N°2007/006 du 26 décembre 2007 portant Régime Financier de l’Etat et qui fait de la performance, une exigence à rechercher par toutes les administrations. Sur cette base, quatre programmes ont été élaborés dont le Programme « Gouvernance et Appui Institutionnel dans le Secteur Santé ». Il vise à : « améliorer la coordination des services et à assurer la bonne mise en uvre des programmes ».\r\nLes éléments de contexte qui ont marqué l’exécution du Programme 530 en 2015 sont : la baisse des recettes pétrolières, les grandes épidémies et pandémies dont la maladie à virus Ebola en Afrique de l’Ouest, les attaques du groupe terroriste Boko Haram dans l’Extrême-Nord du Cameroun, la gestion des réfugiés issus desdites attaques et de la crise en RCA.\r\nToutefois, les éléments ci-dessus ne sauraient mettre en veilleuse les actions spécifiques exécutées en 2015 par ledit Programme. Leur mise en uvre sera analysée dans le présent Rapport Annuel de Performance et s’articule autour de la Coordination des Services dans toute la pyramide sanitaire ; le Développement de la Recherche Opérationnelle en Santé Humaine ; l’Amélioration du Cadre de Travail ; le Contrôle et l’Audit Interne des Services ; le Développement du Système d’Information Sanitaire ; les Etudes stratégiques et la Planification enfin ; la Gestion Budgétaire et Financière.\r\n\r\nPour mettre en oeuvre ce programme, un certain nombre d’actions seront entreprises notamment :\r\n1-\tPilotage stratégique du secteur \r\n2-\tGestion des médicaments, réactifs de laboratoire, dispositifs médicaux et autres produits pharmaceutiques \r\n3-\tAmélioration de l'offre de soins et services de santé \r\n4-\tDéveloppement des Ressources humaines en santé\r\n5-\t Renforcement du financement de la Santé et du Partenariat\r\n6-\tDéveloppement du système d'information sanitaire et la recherche en santé\r\n7-Contrôle et audit interne des structures\r\n	\N	-\r\n\r\n-\r\n\r\n-\r\n\r\n-\r\n\r\n-\r\n\r\n-\r\n	-\r\n\r\n-\r\n\r\n-\r\n\r\n-	\N	\N	\N	\N	Actif	2019-07-02	2019-07-02
