--
-- TOC entry 294 (class 1259 OID 226964)
-- Name: tab18projection_prgactact; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW tab18projection_prgactact AS
 SELECT tache.cpconsommee AS "T",
    sum((cdmt_tache.ri1 + cdmt_tache.re1)) AS "T1",
    sum((cdmt_tache.ri2 + cdmt_tache.re2)) AS "T2",
    sum((cdmt_tache.ri3 + cdmt_tache.re3)) AS "T3",
    programme.idprogramme,
    programme.nom AS programmes,
    cdmt.nom AS cdmts,
    cdmt.anneedebut,
    risque.idrisque,
    risque.nom AS risques,
    programme.code AS codeprogramme,
    action.idaction,
    action.nom AS actions,
    activite.idactivite,
    activite.nom AS activites,
    activite.code AS codeactvite,
    action.code AS codeaction
   FROM (((((((programme
     JOIN action ON ((programme.idprogramme = action.idprogramme)))
     JOIN activite ON ((action.idaction = activite.idaction)))
     JOIN tache ON ((activite.idactivite = tache.idactivite)))
     JOIN cdmt_tache ON ((tache.idtache = cdmt_tache.idtache)))
     JOIN annee ON ((tache.idannee = annee.idannee)))
     JOIN cdmt ON (((cdmt.idcdmt)::double precision = cdmt_tache.idcdmt)))
     JOIN risque ON ((tache.idrisque = risque.idrisque))),
